import './styles.css';

function Background(content) {
  return (
    <body>
      {Title()}
    </body>
  )
}

function Title() {
  return (
    <h1 className="title">Braeden Meikle</h1>
  )
}

function App() {
  return (
    <>
      {Background}
    </>
  )
}

export default App;
